import React from 'react';
import './jumbotron.css'; 

const Jumbotron = () => {
  return (
    <div className="jumbotron">
      <h1>Welcome to LearnEdge</h1>
      <p>Unlock Your Potential with Cutting-Edge Programming Courses</p>
    </div>
  );
}

export default Jumbotron;
